contract FeeManager {
    address public owner;
    uint256 public fee1;
    uint256 public fee2;
    uint256 public fee3;
    uint256 public fee4;

    constructor() {
        owner = msg.sender;
    }

    function changeFee(uint256 newFee1, uint256 newFee2, uint256 newFee3, uint256 newFee4) public {
        require(msg.sender == owner, "Ownable: caller is not the owner");
        fee1 = newFee1;
        fee2 = newFee2;
        fee3 = newFee3;
        fee4 = newFee4;
    }
}

